import logo from './logo.svg';
import Header from './components/Header';

import './App.css';

function App() {
  return (
    <div className="App">
       <Header />
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>

    </div>
  );
}

export default App;
